import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import HomePage from "./HomePage";
import { Jumbotron } from "styled-jumbotron-component";

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <HomePage />
      </div>
    </Provider>
  );
}

export default App;
